import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

const Home = () => {
  return (
    <div>
      {/* Hero Section */}
      <section className="bg-gradient-to-br from-mint-50 to-white section-padding">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="text-center max-w-5xl mx-auto"
          >
            <h1 className="text-4xl md:text-6xl font-bold text-black mb-6">
              Jona â€” <span className="text-coral-500">artista y creador digital</span>.
              <br />DiseÃ±o experiencias, escribo historias y construyo sitios web <span className="text-wine-500">con intenciÃ³n.</span>
            </h1>
            <p className="text-xl text-gray-700 mb-8 max-w-3xl mx-auto">
              Un solo universo creativo: diseÃ±o, cÃ³digo, escritura y mÃºsica. Trabajo para marcas que quieren ser memorables.
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <Link to="/contacto" className="bg-coral-500 hover:bg-coral-600 text-white px-8 py-4 rounded-lg font-semibold text-lg transition-colors duration-200">
                Pedir cotizaciÃ³n
              </Link>
              <Link to="/portfolio" className="border-2 border-wine-500 text-wine-500 hover:bg-wine-500 hover:text-white px-8 py-4 rounded-lg font-semibold text-lg transition-all duration-200">
                Ver trabajos
              </Link>
            </div>
          </motion.div>
        </div>
      </section>

      {/* Resultados Section */}
      <section className="section-padding bg-white">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-center mb-12"
          >
            <h2 className="text-3xl font-bold text-black mb-4">Resultados, no solo pÃ¡ginas</h2>
          </motion.div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {[
              {
                title: 'Velocidad',
                description: '+90 Lighthouse',
                icon: 'âš¡',
                color: 'gold'
              },
              {
                title: 'Mensajes claros',
                description: 'UX/Copy',
                icon: 'ðŸ’¬',
                color: 'tech'
              },
              {
                title: 'Listos para vender',
                description: 'SEO/Analytics',
                icon: 'ðŸ“ˆ',
                color: 'coral'
              }
            ].map((item, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
